#include "ECAPatterns.h"
#import <Foundation/Foundation.h>

NSString* getECAPatternName(int pattern){
    NSArray *pattern_names = [NSArray arrayWithObjects:@"Double Beta",
                              @"Solar",
                              @"Crates",
                              @"Penn Style",
                              @"Channels",
                              @"Half Crates", nil];
    return pattern_names[pattern];
}

int getECAPatternNSteps(int pattern){

    int nsteps[6] = {8, 32, 19, 9, 32, 38};
    return nsteps[pattern];

}

NSMutableArray* getECAPattern(int pattern){

    switch (pattern) {
        case 0:
            return eca_pattern_bb();
            break;

        case 1:
            return eca_pattern_solar();
            break;

        case 2:
            return eca_pattern_crates();
            break;

        case 3:
            return eca_pattern_bonus();
            break;

        case 4:
            return eca_pattern_channels();
            break;

        case 5:
            return eca_pattern_hcrates();
            break;

        default:
            NSLogColor([NSColor redColor], @"ECA Pattern not recognized: %d \n", pattern);
            return nil;
            break;
    }

}

